const categories = ["Entertainment", "Educational", "Work"];

function assignRandomCategory() {
  return categories[Math.floor(Math.random() * categories.length)];
}

// Add random categories to each object
for (let item of oldData) {
  item.categories = assignRandomCategory();
}
// Define the probability of adding the "master" property to each object (e.g., 20% probability)
const probability = 0.2;

// Iterate through the oldData array and add the "master" property randomly
const newData = oldData.map((item) => {
  // Generate a random number between 0 and 1
  const randomValue = Math.random();

  // Check if the random value is less than the probability
  if (randomValue < probability) {
    // Add the "master" property to this object
    item.master = true;
    item.categories = "restaurants";
  }

  return item;
});
export const data = newData;
